import './App.css';
import React, { useState } from 'react';
import AppRouter from './AppRouter'
import { BrowserRouter as Router } from 'react-router-dom'
import { Navbar } from './pages/navbar/Navbar'
import { Header } from './pages/header/header';
import { FlagProvider } from './pages/header/components/FlagContext';

function App() {
  const [isOpen, setIsOpen] = useState(false);

  return (
    <FlagProvider>
      <Router>
        <div className="bg-light-orange h-screen w-screen overflow-x-hidden">
          <Header></Header>
            <div className={`flex transition-all duration-100 ${isOpen ? 'ml-24' : 'ml-0'}`}>
              <Navbar isOpen={isOpen} setIsOpen={setIsOpen} />
              <AppRouter/>
            </div>
          </div>
      </Router>
    </FlagProvider>
  );
}

export default App;
